import React from 'react';

const DailyScorePopup = ({ dailyData }) => {
  if (!dailyData || !dailyData.aggregated_data) {
    return <p>Loading daily data...</p>;
  }

  const {
    'Acceleration(m/s^2)': acceleration,
    'Braking_Intensity': brakingIntensity,
    'Heading_Change(degrees)': headingChange,
    'Jerk(m/s^3)': jerk,
    'SASV': sasv,
    'Speed(km/h)': speedKmh,
    'Speed_Violation': speedViolation,
  } = dailyData.aggregated_data;

  const drivingScore = dailyData.driving_score;
  const drivingCategory = dailyData.driving_category;
  const totalDistanceCovered = dailyData.total_distance_covered_km;
  const totalTrips = dailyData.total_trips;

  return (
    <div>
      <h3>Daily Driving Summary</h3>
      <p>Driving Score: {drivingScore}</p>
      <p>Driving Category: {drivingCategory}</p>
      <p>Total Distance Covered: {totalDistanceCovered} km</p>
      <p>Total Trips: {totalTrips}</p>
      <p>Average Speed: {speedKmh} km/h</p>
      <p>Acceleration: {acceleration} m/s²</p>
      <p>Jerk: {isNaN(jerk) ? 'N/A' : jerk} m/s³</p>
      <p>Braking Intensity: {brakingIntensity}</p>
      <p>Heading Change: {headingChange} degrees</p>
      <p>Speed Violations: {speedViolation}</p>
      <p>SASV: {sasv}</p>
    </div>
  );
};

export default DailyScorePopup;
